import React from 'react';
import logo from './logo.svg';
import { ContainedButtons, SimpleContainer } from "./Catalog";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';
import Abbout from './about';
import IntegrationTextField from './formulario';


function Home() {
  return <><h2>CATALOGO</h2><SimpleContainer/></>;
}

function About() {
  return <><h2>ABOUT US</h2><Abbout/></>;
}

function Editar(){
  return( 
  <a>Formulario</a>

  );
}



function App() {
  return (
    <div className="App">

        <Router>
          <header className="App-header">
            <p>
            <ContainedButtons/>
            </p>
          </header>    

        <Route path="/" exact component={Home}/>

        <Route path="/about" component={About}/>

      </Router>

          <footer>
            Desarrollado por Guillermo
          </footer>


    </div>

  );
}
export default App;
